import React from 'react';
import { DataGrid } from '@material-ui/data-grid';

const columns = [
  { field: "id",
    type: "number", 
    headerName: "ID", 
    width: 100,
    editable: false
  },
  {
    field: "amount",
    type: "number",
    headerName: "Prezzo",
    width: 150,
    editable: false
  },
  {
    field: "currency",
    headerName: "Valuta",
    width: 150,
    editable: false
  },
  {
    field: "title",
    headerName: "Nome",
    type: "number",
    width: 250,
    editable: false
  },
  {
    field: "tradeType",
    headerName: "Asta",
    type: "number",
    width: 150,
    editable: false
  }
];

function App(value) {
return class extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      error: value.error,
      isLoaded: value.isLoaded,
      items: value.items
    };
  }

  render() {
    const { error, isLoaded, items } = this.state;

    const rows = items.map((row) => {
      const { productId, ...rest } = row;
      return { id: productId, ...rest };
    });

    if (error) {
      return <div>Error: {error.message}</div>;
    } else if (!isLoaded) {
      return <div>Loading...</div>;
    } else {
      return (
        <div style={{ height: 1000 , width: "100%" }}>
          <DataGrid
            rows={rows}
            columns={columns}
            id="productId" 
            pageSize={100}
          />
        </div>
      );
    }
  }
}
}


export { App };
